import React from "react";
import { Link } from "react-router-dom";

const ProductCard = ({ sool }) => {
    return(
    <Link to={sool.id}>
      <li className="product__card" id={sool.id}>
        <div className="product__picture">
          <img src={sool.img} />
        </div>
        <div className="product__content">
            <span className="product__name">{sool.name}</span>
            <span className="product__price">1000원</span>
        </div>
      </li>
    </Link>
    )
}

export default ProductCard;
